import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { Container, Input } from 'reactstrap';
const states = [
  'Andhra Pradesh',
  'Arunachal Pradesh',
  'Assam',
  'Bihar',
  'Chhattisgarh',
  'Goa',
  'Gujarat',
  'Haryana',
  'Himachal Pradesh',
  'Jammu and Kashmir',
  'Jharkhand',
  'Karnataka',
  'Kerala',
  'Madhya Pradesh',
  'Maharashtra',
  'Manipur',
  'Meghalaya',
  'Mizoram',
  'Nagaland',
  'Odisha',
  'Punjab',
  'Rajasthan',
  'Sikkim',
  'Tamil Nadu',
  'Telangana',
  'Tripura',
  'Uttarakhand',
  'Uttar Pradesh',
  'West Bengal',
  'Andaman and Nicobar Islands',
  'Chandigarh',
  'Dadra and Nagar Haveli',
  'Daman and Diu',
  'Delhi',
  'Lakshadweep',
  'Puducherry',
];
const DealerMargin = () => {
  const [state, setState] = useState('Andhra Pradesh');
  const [margin, setMargin] = useState('');
  console.log(margin);
  useEffect(() => {
    loadMargin();
  }, []);
  const loadMargin = async () => {
    const result = await axios.get(
      'http://localhost:3003/dealerMargin/madhyapradesh'
    );

    setMargin(result.data);
  };
  console.log('state', state);
  return (
    <Container>
      <h4 className='pt-4 pb-5'>Dealer Margin</h4>
      <div className='w-25'>
        <Input
          type='select'
          onChange={(e) => {
            setState(e.target.value);
          }}>
          {states.map((data, index) => {
            return (
              <option key={index} value={data} name={data}>
                {data}
              </option>
            );
          })}
        </Input>
      </div>
    </Container>
  );
};

export default DealerMargin;
